import React from "react";
import "../default-welcome/default-welcome.css";

class DefaultWelcome extends React.Component {
  render() {
    return (
        <div className="defaultLandingPage">
            <p>This is some text</p>
        </div>
    )
  }
} 

export default DefaultWelcome;
